    playbackData.comments = {"402548a3-4a37-4a0e-bd14-8d9c1eb89c58":[{"id":"345d9d1d-6d8c-458e-a7e9-9dab2642960c","displayCommentEventId":"402548a3-4a37-4a0e-bd14-8d9c1eb89c58","displayCommentEventSequenceNumber":0,"developerGroupId":"f225b7d1-3ec9-43f9-8f80-de77c0074ba2","timestamp":1725587311101,"commentText":"A playback going over early techniques of filtering data in R.&nbsp; We cover <span style=\"font-family: Courier;\">distinct(), filter(), select()</span>, and <span style=\"font-family: Courier;\">arrange()</span>, as well as combinations of these functions.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ca19dc06-6bb3-4131-8c20-4069fb9ff31f":[{"id":"56cad208-8962-41df-82da-7f70fa4a4558","displayCommentEventId":"ca19dc06-6bb3-4131-8c20-4069fb9ff31f","displayCommentEventSequenceNumber":37,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725589222871,"commentText":"Let's begin with some real world motivation.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1725590212447-FilteringMotivation.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"dc614282-64a8-4c9e-b42f-f3fe1b640d83":[{"id":"4125fb2b-d2e2-413d-b88c-58cf16303244","displayCommentEventId":"dc614282-64a8-4c9e-b42f-f3fe1b640d83","displayCommentEventSequenceNumber":86,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725590282519,"commentText":"These lines of code load the data science techniques/functions we will be working with (<span style=\"font-family: Courier;\">tidyverse</span>) and the data set we will be using (<span style=\"font-family: Courier;\">nycflights13</span>).","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"6ab41971-3c80-4102-8aa4-9711559581aa":[{"id":"832b0440-3585-43ae-9e3e-e1dea9221cd3","displayCommentEventId":"6ab41971-3c80-4102-8aa4-9711559581aa","displayCommentEventSequenceNumber":94,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725590400708,"commentText":"The data set we will be working today is stored in the <span style=\"font-family: Courier;\">nycflights13</span> package under the variable name <span style=\"font-family: Courier;\">flights</span>.&nbsp; To get a feel for what data is held in this variable, we can type its name (<span style=\"font-family: Courier;\">print(flights)</span> would also work) to see the first few rows and columns of this dataset (image shown below).<div><br></div><div>Notice that the comments surrounding this tibble tell us that there are actually 336,766 rows we are <span style=\"font-weight: bold;\">not</span> seeing and 12 more columns we are <span style=\"font-weight: bold;\">not</span> seeing.&nbsp; That's a lot of data we are <span style=\"font-weight: bold;\">not</span> viewing here.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725590394428-FlightTibble.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"5ccd5489-6779-49ee-b03f-54192ff0fca7":[{"id":"4758548d-00b6-4703-aa1c-c3d2810a914c","displayCommentEventId":"5ccd5489-6779-49ee-b03f-54192ff0fca7","displayCommentEventSequenceNumber":114,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725590645952,"commentText":"If we wish to have the ability to easily view more data, we can use <span style=\"font-family: Courier;\">View()</span> in RStudio to see the data in a scrollable environment (image shown below).<div><br></div><div>While this might easily allow us to view all columns (only 12 were missing), it is not realistic to scroll through 336,776 rows of data; it's just too much!&nbsp; We need some tools to easily filter this large amount of data to only the data we care about.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725590606849-FlightView.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"5424302e-1ffa-4340-8c33-2917601a629a":[{"id":"4020bd92-cc94-41c7-8fcb-9f5ba88c56a8","displayCommentEventId":"5424302e-1ffa-4340-8c33-2917601a629a","displayCommentEventSequenceNumber":183,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725591185652,"commentText":"While there may be roughly 300,000 rows of data, there are probably not 300,000 different airports in our data set.&nbsp; Remember, we didn't gather this data; what kind of values do we have as possibilities for flight origin?&nbsp;&nbsp;<div><br></div><div>The <span style=\"font-family: Courier;\">distinct()</span> function can be used to find an all encompassing list of the unique values that appear in a given column or columns of a data frame.&nbsp; Here, <span style=\"font-family: Courier;\">flights</span> is our data frame, and the column we wish to examine is the flight origin column (named <span style=\"font-family: Courier;\">origin</span>).&nbsp; &nbsp;Notice that we have used <span style=\"font-family: Courier;\">|&gt;</span> to create a <span style=\"font-style: italic;\">pipeline</span> for our data to travel through (the symbol itself is called a <span style=\"font-style: italic;\">pipe</span>).&nbsp; &nbsp;When we use a pipe, the output from the left is passed as the parameter for the first argument of the function on the right.&nbsp; More on this to come.&nbsp;</div><div><br></div><div>Even this one line of code helps us better understand the data we've been given; there are only 3 possible airport codes listed as origins, and all of them are in New York.&nbsp;&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725591179545-FlightOrigins.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["distinct","image","pipe","pipeline"],"questionCommentData":null}],"86f2bf89-86fa-41b7-9da2-e328c4b706f6":[{"id":"7c1f1547-1583-4a9e-9afa-e4de678c84cf","displayCommentEventId":"86f2bf89-86fa-41b7-9da2-e328c4b706f6","displayCommentEventSequenceNumber":218,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725591346981,"commentText":"We can do a similar process to view total destinations of flights.&nbsp; While O'Hare was not an option for a departing city, it IS an option for a destination city (<span style=\"font-family: Courier;\">ORD</span>&nbsp;is the airport code for O'Hare).","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725591252926-FlightDests.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["image","question"],"questionCommentData":{"allAnswers":["numeric","character","logical"],"correctAnswer":"character","question":"What is the data type of any value held in the <span style=\"font-family: Courier;\">dest</span> column?","explanation":"This is what the chr means in the comment at the top of the tibble."}}],"4d699ce2-5b99-4ffa-9cf6-b8d408d20f8b":[{"id":"7e98aa38-5cf5-4325-8eb0-dcbc02929ef3","displayCommentEventId":"4d699ce2-5b99-4ffa-9cf6-b8d408d20f8b","displayCommentEventSequenceNumber":310,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725591390994,"commentText":"<div>The <span style=\"font-family: Courier;\">filter()</span> function is an important one that allows us to see rows based on the values of the columns.&nbsp; Here, we wish to see just the rows in the data frame that have a destination (<span style=\"font-family: Courier;\">dest</span>) of O'Hare's airport code ORD.</div><div><br></div><div>Two points about syntax are in order here:</div><div><br></div><div>1. Remember that the values in the <span style=\"font-family: Courier;\">dest</span> column are character vectors, so ORD needs to be surrounded by double quotes (\"\") to represent it as a character vector.&nbsp; The value <span style=\"font-family: Courier;\">\"ORD\"</span> is like the right hand side of a variable creation, we just haven't chosen to store this value.&nbsp; This is sometimes called creating a <span style=\"font-style: italic;\">literal</span><span style=\"font-family: Courier;\">&nbsp;</span>value, and we would say that <span style=\"font-family: Courier;\">\"ORD\" </span>here is a <span style=\"font-style: italic;\">string literal</span> or a <span style=\"font-style: italic;\">character vector literal.</span></div><div>2. When checking for equality in R (and many other programming languages) we use <span style=\"font-weight: bold;\">two </span>equal signs (no space), sometimes said aloud as \"double equal\".</div><div><br></div><div>Forgetting to use two equal signs is a VERY common mistake in programming.&nbsp; Luckily, RStudio will stop you from making this mistake by throwing an error&nbsp; (shown below) and providing the correct recommendation.&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725630974130-EqualError.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["==","image","literal","syntax"],"questionCommentData":null}],"dc74a131-8a01-4177-830f-b1538aabf3f8":[{"id":"20f148df-8ce6-45e1-82ae-03fdf8776fba","displayCommentEventId":"dc74a131-8a01-4177-830f-b1538aabf3f8","displayCommentEventSequenceNumber":316,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725591451257,"commentText":"We can do a similar thing to check if there are any flights from New York to Midway (airport code <span style=\"font-family: Courier;\">MDW</span>).","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ff63a3fb-2d1e-4768-b2c5-cd5875dee3e4":[{"id":"9f40f481-56df-4269-a211-e4a296f0c89c","displayCommentEventId":"ff63a3fb-2d1e-4768-b2c5-cd5875dee3e4","displayCommentEventSequenceNumber":333,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725618005665,"commentText":"People who live near Chicago are often willing to travel to either O'Hare or Midway.&nbsp; If we wish to filter for flights that either arrive at O'Hare or Midway, we can ask to filter the flights to those that have a destination (<span style=\"font-family: Courier;\">dest</span>) in a list (vector is the technical term) of permissible values. Here, <span style=\"font-family: Courier;\">c(\"ORD\", \"MDW\")</span> is a list and we use <span style=\"font-family: Courier;\">%in%</span> to check if the row has a <span style=\"font-family: Courier;\">dest</span> value that is in the provided list.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["in","list","syntax","vector"],"questionCommentData":null}],"a9a82d4f-1488-4e8f-9686-4a886aa9461b":[{"id":"6abc0b03-3997-40df-8585-63d305524780","displayCommentEventId":"a9a82d4f-1488-4e8f-9686-4a886aa9461b","displayCommentEventSequenceNumber":404,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725631636764,"commentText":"It is important to remember that when we do something like line 8 (filter the data frame) we do not actually change the <span style=\"font-family: Courier;\">flights</span> data frame.&nbsp; We simply change what is displayed to the screen.&nbsp; It is always best practice to have an original unaltered copy of your data to revert back to.<div><br></div><div>If we wish to save the results of the filtered data frame as a separate object for easier use, and so we don't have to continually filter the data frame, we can save the output of the filter as a separate variable.&nbsp;&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["chicago_flights","flights","filter","dest"],"correctAnswer":"chicago_flights","question":"Using the syntax of line 9 to guide you, what is the name of the new variable we have created?","explanation":"the word on the left of the &lt;- sign is always the variable name."}},{"id":"15bc8803-a8e7-4d9c-8b3f-f507cd4f8a0f","displayCommentEventId":"a9a82d4f-1488-4e8f-9686-4a886aa9461b","displayCommentEventSequenceNumber":404,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725636976530,"commentText":"<div>Recall that the value being created on the right hand side of the assignment operator <span style=\"font-family: Courier;\">(&lt;-</span> ) is assessed before the assignment takes place.&nbsp; The expression on the right hand side is equivalent to what is written on line 8, just written without a pipe.&nbsp; Recall that a pipeline takes whatever is immediately left of the pipe ( <span style=\"font-family: Courier;\">|&gt;</span> ) and uses that as input to the first argument of the next function.&nbsp;</div><div><br></div>You can actually mix assignment operators ( <span style=\"font-family: Courier;\">&lt;-</span> ) with pipes ( <span style=\"font-family: Courier;\">|&gt;</span> ), I've just chosen not to here.","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"f41a28fc-9d00-432f-b2c2-96f063d542cf":[{"id":"ff51a585-d25a-489d-af38-d0befc97b46e","displayCommentEventId":"f41a28fc-9d00-432f-b2c2-96f063d542cf","displayCommentEventSequenceNumber":487,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725637283107,"commentText":"Often, we need to combine functions to get the output we desire.&nbsp; This line combines the <span style=\"font-family: Courier;\">filter()</span> function (to find just the flights that fly to Chicago) and the <span style=\"font-family: Courier;\">distinct()</span> function to remove replicated values.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"eeb1be62-ed6b-4cf2-8f8f-cdba761abd82":[{"id":"92ad64cf-5c82-4028-aa46-b002e0dc982f","displayCommentEventId":"eeb1be62-ed6b-4cf2-8f8f-cdba761abd82","displayCommentEventSequenceNumber":549,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725640961541,"commentText":"This is our first real example of a pipeline involving more than one pipe.&nbsp; We can read this pipeline left to right: First, we take all flights and filter them to only the flights with a destination of \"MDW\".&nbsp; Then, we determine the distinct carriers of the output from the <span style=\"font-family: Courier;\">filter()</span> function via<span style=\"font-family: Courier;\"> distinct()</span>; here, just the flights with a destination of <span style=\"font-family: Courier;\">\"MDW\"</span>.<div><br></div><div>It can sometimes be helpful to have a non-scientific example.&nbsp; Below is an image comparing the pipeline process to making coffee.&nbsp;&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725640904108-PipelineAnalogy.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["image","pipeline"],"questionCommentData":null}],"7f4f7d78-8def-43a7-b941-875c4831aee9":[{"id":"bf7ff4f0-8ddf-45ba-8d5e-f6ce88cb652b","displayCommentEventId":"7f4f7d78-8def-43a7-b941-875c4831aee9","displayCommentEventSequenceNumber":681,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725641196478,"commentText":"<span style=\"font-family: Courier;\">filter()</span> allows you to search for more than just one condition in one column to be met.&nbsp; For example, a customer flying through an airport probably wants to know just the flights that are available to them on the day they are travelling.&nbsp; A specific date is indicated in our set by the combination of variables month and day.&nbsp; To check for all flights on October 17, for example, we need the month to be 10 and the day to be 17.&nbsp; We can use &amp; inside of the <span style=\"font-family: Courier;\">filter()</span> function to make sure both requirements are met.&nbsp;&nbsp;<div><br></div><div>There are two other logical symbols that are helpful for this kind of filtering; first, we use the symbol <span style=\"font-family: Courier;\">| </span>to represent \"or\", and we use<span style=\"font-family: Courier;\"> !</span> to represent \"not\".&nbsp; We will gain more practice with these symbols in upcoming exercises.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"8f4f293a-5766-44b1-afe3-e95a194a525e":[{"id":"f2f0310c-dc12-4ed0-985e-1ad4cdfe983e","displayCommentEventId":"8f4f293a-5766-44b1-afe3-e95a194a525e","displayCommentEventSequenceNumber":736,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725642160123,"commentText":"The next helpful function we will learn about is <span style=\"font-family: Courier;\">select()</span>.&nbsp; Recall that our data had roughly 300,000 rows and 19 columns.&nbsp; While <span style=\"font-family: Courier;\">filter()</span> helps us restrict the number of rows we wish to see, <span style=\"font-family: Courier;\">select() </span>helps us restrict the number of columns we wish to see.&nbsp; Here, we can image a customer not needing to see all the values / variables we have in the data frame (for example, they probably don't need the tail number of the flight).&nbsp;&nbsp;<div><br></div><div>The output of this line of code is shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725642154325-SpecificFlights.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"037c0f56-a773-423e-af04-755df28ffb60":[{"id":"26338634-4ac3-4253-ab12-9cda593be63e","displayCommentEventId":"037c0f56-a773-423e-af04-755df28ffb60","displayCommentEventSequenceNumber":808,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725880746323,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["filterting","assignment"],"correctAnswer":"filterting","question":"Which is done first here, the filtering&nbsp; of <span style=\"font-family: Courier;\">chicago_flights</span> or the assignment to <span style=\"font-family: Courier;\">flight_options</span>?","explanation":"If the assignment were first, we would have a semantics error.&nbsp; We don't want to save something we already have; we want to save a new thing!"}},{"id":"e2e3af2b-2699-4c43-9d6d-40e2d5100e31","displayCommentEventId":"037c0f56-a773-423e-af04-755df28ffb60","displayCommentEventSequenceNumber":808,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725642185883,"commentText":"Since we will be further manipulating the filtered data frame that involves only the chicago flights on October 17, we choose to save this (intermediate) value.&nbsp; Notice that here we combine our assignment operator ( <span style=\"font-family: Courier;\">&lt;- </span>) and our pipe ( <span style=\"font-family: Courier;\">|&gt;</span> ), and note again that the assignment takes place after the other operators (here, the pipe).","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"b8b99489-55b5-4585-9e97-04b40bf6131b":[{"id":"6592069a-0e9c-45f6-a44c-b67a61d549b9","displayCommentEventId":"b8b99489-55b5-4585-9e97-04b40bf6131b","displayCommentEventSequenceNumber":851,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725830695786,"commentText":"The <span style=\"font-family: Courier;\">arrange() </span>function allows us to&nbsp; rearrange a data frame to our liking, rather than relying on the default order in which the data was entered.&nbsp;&nbsp;We can pass multiple column names as arguments to the <span style=\"font-family: Courier;\">arrange() </span>function, and in this case, the function will order the data frame based on the left most column first, the next left most column second, etc.&nbsp;&nbsp;<div><br></div><div>The goal of this part of the code is to arrange the flights to Chicago on our particular day by total flight time, showing the shortest flights first.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["arrange","question"],"questionCommentData":{"allAnswers":["yes","no"],"correctAnswer":"no","question":"Does<span style=\"font-family: Courier;\"> arrange()</span> actually change the order of the data frame?","explanation":"like most of our functions, the data is never truly altered.&nbsp; It is just shown to us as we wish to view it."}}],"e9f7b338-9a00-4965-b370-8f72258960ae":[{"id":"b632f94d-2e49-4a51-b59b-40487497b604","displayCommentEventId":"e9f7b338-9a00-4965-b370-8f72258960ae","displayCommentEventSequenceNumber":809,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725830899544,"commentText":"When I'm travelling, I often want a direct flight whenever possible, or at least, to minimize my travel time.&nbsp; While we are grateful to not have to parse all 300,000 flights for just those heading to Chicago on October 17 ourselves, it would be nice if it were ordered differently.&nbsp; The two circled flights in the image below show my problem with the current status quo: there's a faster flight listed second!&nbsp; We therefore need a way to sort our data according to our or our user's wishes to be as helpful as possible.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1725830753877-SpecificFlights2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"8f955439-f9c6-46b2-bad1-8d6bfd9e669d":[{"id":"b7bf45b7-a813-4de4-abb5-3c524d3456d4","displayCommentEventId":"8f955439-f9c6-46b2-bad1-8d6bfd9e669d","displayCommentEventSequenceNumber":969,"developerGroupId":"cdda97f9-6687-4252-a3ff-7d6ff4d193db","timestamp":1725831034485,"commentText":"Remember, when we selected only certain columns in line 14, we did not choose to store only those columns in the new data frame in line 15.&nbsp; Once we've arranged our data, we still probably only wish to see some subset of columns.&nbsp; We can combine the <span style=\"font-family: Courier;\">arrange()</span> function and the <span style=\"font-family: Courier;\">select()</span> function in a pipeline to perform both actions on our data frame, viewing just the data we want in just the order we want.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/filtering_rows.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}]};
